import React from 'react';
import { makeStyles } from '@material-ui/styles';
import {useTheme} from '@material-ui/core/styles';
import Grid from '@material-ui/core/Grid';
import useMediaQuery from '@material-ui/core/useMediaQuery';
import {Link} from 'react-router-dom';
import growthlogo from '../assets/growthAssets/Growth Final-05.png';
import Typography from '@material-ui/core/Typography';

const useStyles = makeStyles(theme => ({
  container: {
    height: "700px",
    width: "100%",
    justifyContent: "center",
    backgroundColor: theme.palette.common.orange
  },
  logo: {
    height: "275px",
    width: "275px"
  },
  welcome: {
    ...theme.typography.welcome,
  },
}));

export default function Header(props) {

  const classes = useStyles();
  //const theme = useTheme();

  return (
    <Grid container direction="column" className={classes.container}>
      <Grid item container justify="center" >
          <Typography className={classes.welcome} align="center">Schedule</Typography>
      </Grid>
      <Grid item container align="center" direction="row">
        <Grid item container direction="column">
          Monday
        </Grid>
      </Grid>
    </Grid>

  )
}
